import { useState } from "react";
import "./style/Tool.css"
import Predict from "./include/Predict";

const Tool = () => {

    const [tool, setTool] = useState("Predict")

    return (
        <div className="tool_container space_between">
            <div className="tool_change">
                <div className="tool_title">
                    Công cụ
                </div>
                <button 
                    className="button tool_btn"
                    onClick={() => setTool("Predict")}
                >Chatbox</button>
                <button 
                    className="button tool_btn"
                    onClick={() => setTool("Chatbox")}
                >Chẩn đoán</button>
            </div>

            {
                tool=="Chatbox" ?
                null 
                : 
                <Predict />
            }
        </div>
    )
}

export default Tool;
